import './navbar.css'
import menuicon from '../assets/hamburger-30.png';
import closeicon from '../assets/close-24.png';
import {useState} from 'react'
function Navbar()
{
    const [rightview,setRightview] = useState(false)
    function rightSideMenu()
    {
        setRightview(!rightview)
    }
    return(
        <div>
            <nav>
                <div className="navbar-left">
                    <ul>
                        <li><a href='#' active>Portfolio</a></li>
                        <li><a href='#'>Resume</a></li>
                        <li><a href='#'>Contact</a></li>  
                    </ul>
                </div>
                <div className="navbar-right">
                    <ul>
                        <li><img src={menuicon} onClick={rightSideMenu} style={{cursor:"pointer"}}></img></li>
                    </ul>
                    <div className={rightview?'right-side-menu':'right-side-menu-disabled'}>
                            <div style={{display:"flex",paddingLeft:"1vw"}}>
                                <h1 style={{justifyContent:"flex-start"}}>Sasidev</h1>
                                <img style={{justifySelf:'flex-end'}} alt="close" src={closeicon}></img>
                            </div>
                    </div>
                </div>

            </nav>
        </div>
    )
}

export default Navbar;
